;; **
;;; Eliminamos los valores nil del dataset de entrenamiento
;; **

;; @@
(defn no-hay-nil? [elt]
  (->> elt
    (filter #(not (nil? %)))
    (count)
    (= (count elt))
    ))

(def df-original-sin-valores-nil (->> df-original
                       				(filter no-hay-nil?)
                                   (core/dataset variables)))

(shape df-original-sin-valores-nil)
