;; <=

;; **
;;; Vemos que no podemos separar ninguna variable en función de sus valores para cada una de las categorias de la variable "Class"
;;; 
;;; Ahora, vamos a ver la relación entre pares de variables
;; **

;; @@
(defn dibuja-scatter [dataset caract1 caract2]
  (-> (core/with-data dataset
                      (charts/scatter-plot caract1 caract2 :group-by "Class"))
    (render/chart-view)))

(->> (rest variables-numericas)
  (map #(dibuja-scatter df-original-sin-valores-nil (first variables-numericas) %)))
