;; **
;;; Como podemos ver de las graficas bidimensionales, no podemos separar los 2 valores de la clase.
;;; 
;;; Hallamos las componentes principales
;; **

;; @@
(def pca (->> (core/sel df-original-sin-valores-nil :cols variables-numericas)
           (stats/covariance)
           (stats/principal-components)))
(def pca-valores (:std-dev pca))
(def pca-vectores (:rotation pca))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ejemplo-data-science/pca-vectores</span>","value":"#'ejemplo-data-science/pca-vectores"}
;; <=

;; **
;;; Analizamos para ver cuantos componentes principales necesitamos para que se puedan explicar el 95% o mas de la varianza
;; **

;; @@
(def suma-valores (reduce + pca-valores))
(defn porcentaje [elt]
  (* (/ elt suma-valores) 100))
(def vector-porcentajes (map #(porcentaje %) pca-valores))
vector-porcentajes
